import React, { Component } from 'react';
// import { connect } from 'react-redux';


class ExpenseTable extends Component {
    constructor() {
        super()
        this.state = {}
    }

    render(){
        return(
            <table className = "highlight centered bordered">
        <thead>
          <tr>
              <th>Name</th>
              <th>Date</th>
              <th>Amount</th>
              <th>Edit</th>
              <th>Delete</th>
          </tr>
        </thead>

        <tbody>
          <tr>
            <td>
                <button className="btn green darken-2 waves-effect waves-light" type="submit" name="action">Edit
                    <i className="material-icons right">edit</i>
                </button>
            </td>
            <td>
                <button className="btn red waves-effect waves-light" type="submit" name="action">Delete
                    <i className="material-icons right">delete_forever</i>
                </button>
            </td>
          </tr>
        </tbody>
      </table>
        )
    }
}

export default ExpenseTable
